B.HY=new A.bB(B.fd,[B.Gc,"DOST-FPRDI Experience","Forest Products Research & Development Institute","As of July 15, 2025, I have completed 396 hours of on-the-job training at the Department of Science and Technology \u2013 Forest Products Research and Development Institute (DOST-FPRDI) in Los Ba\xf1os, Laguna.\n\nI was assigned to the Training Services Division \u2013 Training and Manpower Development Services Section (TSD-TMDSS), which conducts training programs nationwide based on the needs of requesting organizations. My main role was to help digitize records, organize data, and support systems that reduce manual workloads and improve productivity.\n\nTSD-TMDSS delivers training both face-to-face and online. Trainings cover wood and bamboo processing and utilization technologies for livelihood, combining lectures, demonstrations, and hands-on activities.\n\n"],t.yf)
B.Fe=A.b(s(["assets/training.png","assets/map2.png","assets/map3.png","assets/map4.png","assets/map5.png","assets/map6.jpeg","assets/map7.png","assets/map8.png"]),t.s)
B.HX=new A.bB(B.fd,[B.Fe,"GIS Training Map System","Web-based Training Management Platform","The DOST Training GIS Map is a web-based system that replaced the outdated paper-based process for managing training records. Previously, staff had to manually encode data into PDFs, making reporting slow, error-prone, and hard to analyze. As part of our on-the-job training, we were tasked to design and develop the GIS system to modernize how training activities are tracked and presented. My main role in the project was to develop the dynamic filter functions and implement the full set of admin features. I created filters that allow users to sort and search training data by region, province, city, year, month, and training type, making it easier to access specific information quickly. I also developed the admin dashboard, which includes Create, Read, Update, and Delete (CRUD) functionalities to manage training records securely and efficiently. The system was built using the Flutter programming language for a smooth, cross-platform web interface, Google Maps API to visualize training locations, and Supabase for user authentication and data storage. With the help of my supervisors and their feedback throughout the development process, I was able to refine the features and improve usability. This system will help staff generate clear, organized reports that can be easily presented to higher management, supporting better decision-making and internal planning."],t.yf)
B.Fp=A.b(s(["assets/cert1.jpg","assets/cert2.png","assets/cert3.png","assets/cert4.png","assets/cert5.png","assets/cert6.png","assets/cert7.png","assets/cert8.jpg","assets/cert9.jpg","assets/cert10.jpg","assets/cert11.png"]),t.s)
B.HV=new A.bB(B.fd,[B.Fp,"Certificate Generator Tool","Automated Certificate Generation System","The Certificate Generator was developed specifically for TMDSS-DOST to address the time-consuming and manual process of issuing certificates after training sessions. Each training typically collects responses from three separate forms\u2014Attendance, Background, and Evaluation\u2014and staff previously had to check each participant one by one to see if they completed all required forms, then manually list the eligible names and type them into certificates. To solve this, I developed a user-friendly tool that automates the entire process. The system allows staff to import CSV files from the three forms and intelligently cross-check attendance to identify eligible participants. I designed a customizable certificate template interface with drag-and-drop name placement, font selection, and layout options. The app generates personalized PDF certificates with dynamically positioned names, significantly reducing manual work. One of the key challenges was handling font compatibility for special scripts and ensuring the drag-and-drop editor could accurately save templates as configured. With ongoing testing and supervisor feedback, I refined the system to streamline certificate preparation, improve accuracy, and help staff issue certificates faster and more efficiently."],t.yf)
B.Ge=A.b(s(["assets/FPRDI.png"]),t.s)
B.HW=new A.bB(B.fd,[B.Ge,"Synthesis of OJT Experience","OJT of Training Services Division- Training and Manpower Development Services Section (TSD-TMDSS)","During my internship at DOST-FPRDI, I enhanced my abilities in software development, data management, and project documentation. I gained knowledge in designing and testing systems like the GIS Training Tracker and Certificate Generator, assisted in digitization projects, and worked effectively with a professional team. This experience deepened my understanding of the role of IT in enhancing training operations and driving innovation and sustainability."],t.yf)
